import React from "react";
import { ColorString } from "./ColorPalette";

export function Head() {
  return (
    <header>
      <div
        style={{
          display: "flex",
          alignContent: "center",
          justifyContent: "center",
          flexDirection: "row",
          height: 58,
          backgroundColor: ColorString.schmoozGreen,
        }}
      >
        <div
          style={{
            flex: 1,
            display: "flex",
            flexDirection: "row",
            justifyContent: "space-evenly",
            textDecoration: "none",
            alignItems: "center",
          }}
        >
          <a
            className="text-medium"
            style={{
              textDecoration: "none",
              color: ColorString.white,
              fontWeight: "bold",
            }}
            href="https://pluralsight.com"
          >
            About
          </a>
          <a
            className="text-medium"
            style={{
              textDecoration: "none",
              color: ColorString.white,
              fontWeight: "bold",
            }}
            href="https://pluralsight.com"
          >
            Terms
          </a>
          <a
            className="text-medium"
            style={{
              textDecoration: "none",
              color: ColorString.white,
              fontWeight: "bold",
            }}
            x
            href="https://pluralsight.com"
          >
            Contact
          </a>
        </div>
        <div style={{ flex: 1 }}></div>
        <div style={{ flex: 1 }}></div>
      </div>
    </header>
  );
}
